import React from "react";
import ReactDOM from "react-dom/client";
import "./styles/index.css";
import "./styles/materialize.css";
import "./js/materialize.min.js";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
